import React from "react";
import ReactDOM from "react-dom";
import { responsive_mock } from "./responsive.js";
export class Mocktest_header extends React.Component{
    constructor(){
        super()
        this.state={style:responsive_mock.header.Main()}
        this.resize=this.resize.bind(this)
        window.addEventListener('resize',this.resize)
    }
    resize()
    {
        this.setState({style:responsive_mock.header.Main()})
    }
    render(){
        return <div style={this.state.style}>
            <h1 style={{textAlign:'center'}}>MOCK TEST</h1>
            <hr style={{border:'1px solid grey'}}/>
        </div>
    }
}
